import React from "react";
import styled from "styled-components";

export default function Category() {
  return (
    <CategoryContainer>
      <span>카테고리</span>
    </CategoryContainer>
  );
}

export const CategoryContainer = styled`
  display: flex;
    -webkit-box-align: center;
    align-items: center;
    height: 100%;
& span{font-size: 16px;
  font-weight: 500;
  line-height: 20px;
  letter-spacing: -0.3px;
  color: rgb(51, 51, 51);}

`;
